        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵtext"](101, " La m\u00E9thode EFT, acronyme d' \u00BBEmotional Freedom Technique \u00BB, peut \u00EAtre traduite comme une technique de lib\u00E9ration \u00E9motionnelle. C\u2019est une technique psycho-corporelle qui utilise les m\u00E9ridiens \u00E9nerg\u00E9tiques chinois (les m\u00EAmes qu\u2019en acupuncture). L\u2019EFT permet de g\u00E9rer ou d\u00E9programmer des r\u00E9actions \u00E9motionnelles grav\u00E9es en nous qui provoquent stress, peur ou anxi\u00E9t\u00E9. Concr\u00E8tement, il s\u2019agit de tapoter ou de frotter doucement certains points sp\u00E9cifiques situ\u00E9s sur nos m\u00E9ridiens. En tapotant ainsi tout en pensant \u00E0 ce qui nous d\u00E9range, on \u00E9quilibre les m\u00E9ridiens perturb\u00E9s. Vous conservez ainsi la m\u00E9moire de l\u2019\u00E9v\u00E8nement qui vous a d\u00E9rang\u00E9, mais cette m\u00E9thode a pour promesse que vous n\u2019en ressentiez plus la charge \u00E9motive qui l\u2019accompagnait. ");
