        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵtext"](107, " L'EFT permet de g\u00E9rer ou d\u00E9programmer des r\u00E9actions \u00E9motionnelles grav\u00E9es en nous qui provoquent stress, peur ou anxi\u00E9t\u00E9. Concr\u00E8tement, il s'agit de tapoter ou de frotter doucement certains points sp\u00E9cifiques situ\u00E9s sur nos m\u00E9ridiens. Mieux vivre et g\u00E9rer ses \u00E9motions est une probl\u00E9matique des plus actuelle, dans une soci\u00E9t\u00E9 ou le stress envahit notre quotidien. L\u2019EFT utilise le tapping sur des points d\u2019acupuncture pour r\u00E9guler les \u00E9nergies. ");
