        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵelementStart"](112, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵtext"](113, " C\u2019est la principale action de l\u2019EFT : \u00F4ter une \u00E9motion n\u00E9gative qui vous ronge et vous freine. Se d\u00E9barrasser de certaines craintes ou phobies Peur du noir, phobie scolaire\u2026 Enfants comme adultes peuvent faire face \u00E0 des nombreuses peurs. Booster la confiance en soi. Je d\u00E9termine avec la personne (adulte comme enfant) la situation ou le probl\u00E8me qui provoque l\u2019\u00E9motion \u00E0 g\u00E9rer. Au cours de cet entretien, je demande au patient comment il se sent physiquement quand il vit cet \u00E9v\u00E9nement (est-ce qu\u2019il transpire, est-ce qu\u2019il rougit, est-ce qu\u2019il a le ventre qui se noue\u2026) et \u00E9motionnellement (ressent-il du stress, de la peur, de la tristesse, de la col\u00E8re ?). Cette \u00E9tape se fait simplement dans une \u00E9coute sans jugement de ma part, c\u2019est une discussion \u00E0 b\u00E2ton rompu. Je demande de noter l\u2019importance de l\u2019\u00E9motion ressentie. Ainsi on sait directement quelle \u00E9motion travailler en premier. C\u2019est l\u2019anamn\u00E8se, cela me permet de \u00AB cibler \u00BB correctement la demande du patient et ainsi simplifier la t\u00E2che. ");
