        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵelementStart"](118, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵtext"](119, " Au d\u00E9but de la s\u00E9ance d\u2019EFT, je m\u2019occupe d\u2019identifier l'origine de votre probl\u00E8me, en mettant le doigt sur la situation ou le probl\u00E8me qui provoque l'\u00E9motion \u00E0 g\u00E9rer. J\u2019interviens ensuite pour \u00E9valuer le degr\u00E9 d'intensit\u00E9 de l'\u00E9motion en vous demandant de noter le degr\u00E9 de l'\u00E9motion ressentie. Je vous demanderai ensuite de r\u00E9p\u00E9ter \u00E0 plusieurs reprise une phrase-cl\u00E9 positive, tout en vous tapotant le point du karat\u00E9 (en dessous du pouce). Cette phrase de d\u00E9marrage peut \u00EAtre une phrase du type \"je m'aime et je m'accepte compl\u00E8tement\" ou encore \"m\u00EAme si je suis stress\u00E9 par ce devoir \u00E0 l'\u00E9cole, je me fais confiance\". Passons ensuite \u00E0 la ronde EFT, cette phase a pour int\u00E9r\u00EAt de stimuler les m\u00E9ridiens tout en restant concentr\u00E9 sur la situation probl\u00E9matique. Je tapote une dizaine de fois sur chacun, en partant du sommet du cr\u00E2ne, en allant jusque sous la poitrine. Une fois la ronde est termin\u00E9e, je vous invite \u00E0 respirer profond\u00E9ment et de repenser \u00E0 la situation. J\u2019analyse ensuite l'intensit\u00E9 de votre \u00E9motion et e v\u00E9rifie si elle a diminu\u00E9. A partir du r\u00E9sultat obtenu, je pourrai modifier la phrase de d\u00E9marrage ou vous faire recommencer une nouvelle ronde, jusqu'\u00E0 faire baisser l'\u00E9motion \u00E0 un niveau acceptable. Que vous soyez \u00E0 Segr\u00E9, au Lion-d\u2019Angers, \u00E0 Montreuil-Juign\u00E9, \u00E0 Beaucouz\u00E9 ou encore \u00E0 Avrill\u00E9, je vous re\u00E7ois \u00E0 mon domicile pour des s\u00E9ances d\u2019EFT adapt\u00E9es \u00E0 votre situation. J'ai \u00E9galement la possibilit\u00E9 de me d\u00E9placer chez vous ou en institut. ");
